import React from 'react';

export const Navbar: React.FC = () => {
  return (
    <div className="flex items-center justify-between p-10">
      <div>
        <h1 className="font-bold text-white text-4xl" style={{ fontFamily: 'era', textAlign: 'center' }}>
          TAYLOR SWIFT: THE ERAS TOUR TRACKER
        </h1>
        <h1 className="text-white text-xl" style={{ fontFamily: 'folklore', textAlign: 'center' }}>
          Click on the map markers to see the dates and shows for each city!
        </h1>
      </div>
      <div>
        <a href="https://github.com" target="_blank" rel="noopener noreferrer">
          <img
            src="/path/to/github-logo.png" // Replace '/path/to/github-logo.png' with the actual image path
            alt="GitHub"
            className="github-logo"
          />
        </a>
      </div>
    </div>
  );
};

export default Navbar;
